(18, 'El tunel de fin de año', '', 'El Tunel de fin de año con Radioactiva. El Planeta Rock', 19, '2012-12-30', '09:00:00', 0, NULL, NULL, 2, 2, 1, 10, 'images/eventos/18/imagen_principal_fin-de-ano-sampues-2012.jpg'),
