(137, 'cumpleañeros', 'CELEBRA TU CUMPLEAÑOS EN TUTAINA TUTURUMA', '<p>\r\n	CELEBRA TU CUMPLEA&Ntilde;OS EN TUTAINA TUTURUMA..DECORACI&Oacute;N DE MESA, LA TORTA, LA VELA VOLC&Aacute;N, CORONA DE CUMPLE,COP&Oacute;N DE TEQUILA SUNRISE.<br />\r\n	ARTISTAS EN VIVO, PERSONAJES,LA MEJOR ANIMACI&Oacute;N Y M&Uacute;SICA CROSSOVER.</p>\r\n', 55, '2013-10-25', '22:00:00', 0, '0000-00-00', 7, 51, 2, 1, 1, 'images/eventos/137/imagen_principal_tutainatuturuma.jpg'),
