(139, 'HALLOWEEN', 'SHOW DE THRILLER EN VIVO 1 Y 2 DE NOVIEMBRE! ', '<p>\r\n	SHOW DE THRILLER EN VIVO 1 Y 2 DE NOVIEMBRE! Vive Halloween en Cosmopolitan Bar Rumba oficial de disfraces 2 de Nov, GANA 500.000 el disfraz m&aacute;s Original!</p>\r\n', 62, '2013-11-01', '21:00:00', 1, '2013-11-02', 7, 51, 2, 1, 1, 'images/eventos/139/imagen_principal_cosmopolitanbar.jpg'),
