(141, 'ANIVERSARIO ', '5to Aniversario karma', '<p>\r\n	No te puedes Perder de una gran celebraci&oacute;n en karma su 5to aniversario una noche de muchas sorpresas y regalos.</p>\r\n<p>\r\n	&nbsp;</p>\r\n', 34, '2013-11-15', '22:00:00', 0, '0000-00-00', 7, 51, 2, 1, 1, 'images/eventos/141/imagen_principal_karmacumpleaños.jpg'),
(142, 'NOCHE PLAY BOY', 'NOCHE DE PLAY BOY', '<p>\r\n	Programate y Reserva desde ya para que vivas la mejor noche PLAY BOY en la garganta.</p>\r\n', 67, '2013-11-22', '22:00:00', 0, '0000-00-00', 7, 51, 2, 1, 1, 'images/eventos/142/imagen_principal_lagarganta.jpg'),
