(52, 1, 'Nuestro Bar', 'nuestro-bar', NULL, '310 5054105', '¿Te gusta el rock, escucharlo, sentirlo, vivirlo o hasta tocarlo? Nuestro bar es el sitio perfecto para todos los amantes de la verdadera música ¡¡¡el Rock!!!! grupos en vivo, batallas de bandas y toda la buena energía de la gente', '', 'Calle 33 # 65 B 67, Medellín', 0, 1, 1, 52, -1, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/52/logoperfil.jpg', '', '21:00:00', 0, 1, 0),
(53, 1, 'Memorias', 'memorias', NULL, '411 27 27', 'Videos y conciertos de artistas inmortales de los años 60, 70 y 80 en grandes pantallas y un ambiente acogedor, es el secreto de Memorias Video Bar para hacer que todos sus asistentes canten a la par todas las inolvidables  canciones y se sientan como en esas épocas de oro', NULL, 'Calle 33 #74E - 161', 0, 1, 1, 52, NULL, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/53/logoperfil.jpg', '', '21:00:00', 0, 1, 0),
(54, 3, 'Shots del diablo', 'shotsdldiablo', 0, '301 4431375', 'Somos un bar urbano, diferente de lo que conoces en la 33, nuestra atención e identidad están dirigidas a un publico conocedor de la rumba urbana, ritmos como Dancehall / R&B / Reggae / Reggaeton y Hip hop son llevados a su maximo nivel. Decks a cargo de DJ BLACK (residente) Conoce nuestra nueva zona VIP.', '', 'AV 33 # 78 - 17, Medellín', 0, 1, 1, 52, 2, 'AV 33', '', 2, 5000, 50000, '', 'Parqueadero gratis al aire libre 8 espacios', 0, 'images/lugares/54/LOGO SHOTSDLDIABLO.jpg', '', '19:00:00', 0, 1, 0),
