(60, 3, 'Mixology Molecular Bar', 'mixology', NULL, '313 703 51 45', 'Mixology es el primer bar de cocteles moleculares en Colombia y el segundo en Latinoamérica. \r\nOfrece a sus clientes los cocteles moleculares, en ellos se modifica el estado de la materia para generar sabores diferentes con preparaciones unicas\r\n', '', ' Estamos ubicados en La Milla de Oro, en el Séptimo Piso del Centro Comercial Río Sur. Carrera 43A Nro. 6 Sur - 26', 0, 1, 1, 52, 1, 'El Poblado', '', 1, 15000, 30000, '', 'En el Lugar', 0, 'images/lugares/60/logo.jpg', '', '00:00:00', 0, 1, 0),
(61, 3, 'Arte Vivo', 'arte-vivo', NULL, '4441609 / 3520074', 'Arte Vivo es tal vez el sitio más reconocido de su género en la ciudad\r\nEste restaurante bar ofrece dos bandas de rock en vivo (clásicos y rock suave), ya conocidas por su calidad musical a la hora de interpretar los mejores temas.\r\nLa comida, la atención y la música en vivo hacen que el ambiente tome una energía especial.', '', 'Calle 9 Nro 43B 68', 0, 1, 1, 52, 1, '', '', 1, 5000, 70000, '', '', 0, 'images/lugares/61/logo.jpg', '', '00:00:00', 0, 1, 0),
(62, 3, 'Cosmopolitan', 'cosmopolitan', NULL, '311 769 6032 - 311 749 2257', 'Cosmopolitan, Rumba 100% Crossover para todos los gustos\r\nCelebramos TU CUMPLEAÑOS con torta, MEDIA DE GUARO y decoración\r\nmartes, miércoles y jueves 2x1 en licor nacional\r\nviernes y sábado rumba personalizada\r\nLOS MEJORES PRECIOS', '', 'Calle 49 #28-51 Zona Rosa Buenos Aires (Antes de las mellizas)', 0, 1, 1, 52, 10, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/62/logo.jpg', '', '00:00:00', 0, 0, 0),
(63, 1, 'Palmitas', 'palmitas', NULL, '2327199', 'Tiene varios de sus ambientes con música en vivo y presentaciones de músicos, cantantes y bailarines. La discoteca tiene constantes shows con parejas de tango, carnaval o música árabe. ', '', 'Carrera 38 #26-41 (Km 1 Vìa Las Palmas)', 0, 1, 1, 52, 1, 'Poblado', '', 1, 5000, 70000, '', '', 0, 'images/lugares/63/logo-ok.jpg', '', '00:00:00', 0, 0, 0),
(64, 1, 'OpenSky', 'opensky', NULL, '311 94 58', 'Ofrece un un ambiente tranquilo y agradable con una amplia variedad de licores.\r\n\r\nEn el segundo piso está la barra del bar, mesas,  sofás y un ventanal con vista a la calle que le brinda frestura y tranquilidad para los visitantes.\r\nEn el tercer piso hay una terraza con mas tiene más mesas y sofás ubicados por todo el lugar.', '', 'Carrera 38 #8-13', 0, 1, 1, 52, 1, '', '', 1, 5000, 70000, '', '', 0, 'images/lugares/64/logopagina.jpg', '', '00:00:00', 0, 0, 0),
(65, 1, 'Bangkok Fusion', 'bangkok-fusion', NULL, '317 5733129', 'En Bangkok Fusion Medellin encuentras una deliciosa fusión de sabores thai presentada en pequeños platos a buenos precios. Tenemos un DJ que anima la rumba urbana en la noche, acompañada de nuestros licores tradicionales y cocteles propios.', NULL, 'Carrera 43 A No. 6 Sur-26 Loc 707', 0, 1, 1, 52, 1, '', '', 1, 5000, 70000, '', '', 0, 'images/lugares/65/logoperfil.jpg', 'images/lugares/65/imagen_perfil-logoperfil.jpg', '00:00:00', 0, 1, 0),
(66, 3, 'La Fonda del Lleras', 'la-fonda-del-lleras', NULL, '311 09 46', 'Aquí puedes disfrutar de un ambiente cálido al son de unas deliciosas y cebadoras empanaditas de iglesia, de pataconcitos, chorizos, chuzos, carnes a la parrilla, picadas con de todo, etc... Aaah y qué decir del consomé y los pasantes que son únicos (carnita, chicharrón, manguito, zanahoria, maní, etc.). Todo al carbón (carnes maduradas)!!!', '<ul>\r\n	<li>\r\n		Mesa decorada</li>\r\n	<li>\r\n		Torta</li>\r\n	<li>\r\n		Vela</li>\r\n	<li>\r\n		Coctel</li>\r\n</ul>\r\n', 'Carrera 38 # 8-49. Parque Lleras', 0, 1, 1, 52, 1, '', '', 1, 5000, 70000, '', '', 0, 'images/lugares/66/logoperfil.jpg', '', '00:00:00', 0, 1, 1),
