(83, 1, 'La Tienda de la 70', 'la-tienda-de-la-70', NULL, '2606783', 'BIENVENIDOS A UN LUGAR DIFERENTE DONDE TODOS LOS DIAS ES DICIEMBRE Y CUANDO UNO SE SIENTA EN UNA MESA PARECE TRANSPORTARSE AL PUEBLO MAS TIPICO DE ANTIOQUIA.\r\n\r\nUn lugar cuidadosamente decorado como en las grandes tiendas de pueblo en las que no faltan los cachivaches, los dulces, el mercado, las instalaciones de navidad y todo dentro de un ambiente muy colorido y alegre.  Provoca sentarse, pedir un trago, provoca ir con los amigos y dejarse llevar por la música crossover. ', '', '', 100, 1, -1, -1, 2, 'laureles', 'http://www.latiendaparrandabar.com/', 1, 15000, 70000, '', '', 0, 'images/lugares/83/logoperfil.jpg', '', '20:00:00', 0, 0, 0),
(84, 1, 'Gar Bar - Terraza Bar', 'gar-bar', NULL, '3115784', 'CERVEZA, POKER Y AMIGOS', '', 'CARRERA 39 N- 8-58 PARQUE LLERAS', 0, 1, 1, 52, NULL, '', '', 2, 5000, 10000, '', '', 0, 'images/lugares/84/logo.jpg', '', '00:00:00', 0, 0, 0),
