(87, 3, 'Chaston Bar', 'chaston-bar', 0, '266 68 45', '', '<p>\r\n	En tu cumplea&ntilde;os Chaston te regala 1/2 de Guaro, Torta, Decoraci&oacute;n y bonos de descuento para motel.</p>\r\n<p>\r\n	*No olvides hacer siempre tu reservaci&oacute;n</p>\r\n', 'Cra 39 #8-82, 57 Medellín, Antioquia', 0, 1, 1, 52, NULL, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/87/logo.jpg', '', '00:00:00', 0, 0, 0),
(88, 3, 'Street Shots', 'street-shots', NULL, '3128788', '', '<p>\r\n	Deben hacer la reserva y se les obsequia un paquete de cumplea&ntilde;os.</p>\r\n', 'calle 8 NO.37a 59', 0, 1, 1, 52, NULL, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/88/logoperfil.jpg', '', '00:00:00', 0, 0, 0),
(89, 11, 'Lleras Town', 'lleras-town', NULL, '-', '', '', '', 0, 1, 1, 52, NULL, '', '', 1, 5000, 10000, '', '', 0, 'images/lugares/89/logoperfil.jpg', '', '00:00:00', 0, 0, 0),
(90, 11, 'El Aguacate Arbol', 'el-aguacate', NULL, '352 0571', 'La mayor expresión de nuestro mestizaje se puede apreciar en la Comida Colombiana.\r\n\r\nBienvenidos a este viaje por el sabor, bienvenidos a este viaje a la sombra de un aguacate.\r\n\r\nAbierto todos los dias apartir de las 12 del dia y los domingos a las 9 a.m.\r\n\r\nValet Parking GRATIS!', '', 'Calle 7D No. 39-262 ', 0, 1, 1, 52, NULL, '', 'http://www.restauranteaguacatearbol.com/', 1, 5000, 50000, '', '', 0, 'images/lugares/90/logoperfil.jpg', '', '00:00:00', 0, 0, 0),
(91, 3, 'Palo Grande', 'palo-grande', NULL, '4440851', 'La Fonda Palogrande ofrece el mejor ambiente típico antioqueño, en ella se celebra con la mejor música y es el lugar ideal para la celebración de sus fiestas.', '', 'Dirección: Carrera 43A Nº 29 Sur 47 (ENVIGADO, ANT.)', 0, 1, 1, 52, -1, '', 'www.restaurantepalogrande.com', 1, 15000, 50000, '', 'si', 0, 'images/lugares/91/logoperfil.jpg', '', '19:00:00', 0, 1, 0),
(92, 12, 'Adonay', 'adonay', 10000, '2689307', 'EN UNO DE LOS LUGARES MAS AGRADABLES DE LA CIUDAD DE MEDELLÍN, LAS PALMAS SE ENCUENTRA LA FONDA ADONAY, UN LUGAR TÍPICO DE DONDE SE DIVISA GRAN PARTE DE LA CIUDAD, CON AMPLIOS Y SEGUROS PARQUEDEROS.', '<p>\r\n	ADONAY FONDA TE CELEBRA TU CUMPLEA&Ntilde;OS !!!</p>\r\n<p>\r\n	TE DECORAMOS LA MESA Y TE OBSEQUIAMOS .......</p>\r\n<p>\r\n	CUMPLEA&Ntilde;ERO : SOMBRERO, CORBATA, PITOS, VELA VOLCAN, PONQUE BROWNIE Y MEDIA DE AGUARDIENTE !!!!</p>\r\n<p>\r\n	CUMPLEA&Ntilde;ERA : CORONA,COLLAR,ANILLO DE LUCES, VELA VOLCAN, PONQUE BROWNIE Y MEDIA DE AGUARDIENTE !!!</p>\r\n<p>\r\n	VEN Y FESTEJA CON TODAS LAS DE LA LEY !!!</p>\r\n', 'Calle 18 #35-81, Medellín', 0, 1, 1, 52, 14, '', '', 1, 20000, 70000, '', 'SI', 1, 'images/lugares/92/logoperfil.jpg', 'images/lugares/92/imagen_perfil-logoperfil.jpg', '19:00:00', 0, 0, 0),
(93, 12, 'La Vecindad del Chavo', 'la-vecindad-del-chavo', NULL, '2355590', 'aca podes reservar tu mesa para eventos y obtener informacion de primera mano para tus eventos en fonda la vecindad del chavo!!!!!!!!!', '', 'Avenida 33 # 65c 60, Medellín', 0, 1, 1, 52, NULL, '', '', 1, 15000, 70000, '', '', 0, 'images/lugares/93/logoperfil.jpg', 'images/lugares/93/imagen_perfil-logoperfil.jpg', '21:00:00', 0, 0, 0),
(94, 1, 'Mi Habana', 'mi-habana', NULL, '266 67 16', '', '', 'CRA. 40 No.9-15', 0, 1, 1, 52, NULL, '', '', 1, 15000, 70000, '', '', 0, 'images/lugares/94/logoperfil.jpg', 'images/lugares/94/imagen_perfil-logoperfil.jpg', '00:00:00', 0, 0, 0),
(95, 1, 'Karaoke', 'karaoke', NULL, '316 7408061', 'Pasa un momento lleno de diversión y alegría con tus mejores amigos o familia interpretando tus canciones favoritas.\r\n\r\nUn lugar para que te conviertas en estrella y disfrutes cantando como toda una celebridad.\r\n\r\nDemuestra tu talento oculto y las ganas de sacar ese cantante que llevas dentro.', '', 'CENTRO COMERCIAL PREMIUM PLAZA LOCAL 3101 Medellín, Colombia', 0, 1, 1, 52, -1, '', '', 1, 20000, 70000, '', 'si', 0, 'images/lugares/95/logoperfil.jpg', '', '19:00:00', 0, 0, 1),
(96, 11, 'Terra', 'terra', NULL, '6042112', 'La culinaria del Peru es resultado de una fusion milenaria de muchas culturas, que hoy se expresan en nuestra propuesta gastronomica.\r\nPor ello como peruanos, nos sentimos orgullosos de ser embajadores de esta gran herencia y asi con gran pasion convertimos ese legado en una gran experiencia para que ustedes ahora la disfruten.', '', 'Carrera 43a #1 sur - 124, C.C. La Strada Medellín', 0, 1, 1, 52, NULL, '', 'http://www.terrafusionperu.com', 1, 20000, 70000, '', 'si', 0, 'images/lugares/96/logoperfil.jpg', 'images/lugares/96/imagen_perfil-logoperfil.jpg', '20:00:00', 0, 0, 0),
(97, 1, 'El Egrem', 'el-egrem', NULL, '317 5733129', 'EL EGREM BAR, un lugar donde todo puede pasar, desde una buena rumba crossover dirigida por nuestro DJ hasta un karaoke de los 60´s', '', 'Carrera 43 A N 6 Sur 26 int 117-118-119 Medellín', 0, 1, 1, 52, NULL, '', '', 1, 15000, 70000, '', 'si', 0, 'images/lugares/97/logoperfil.jpg', 'images/lugares/97/imagen_perfil-logoperfil.jpg', '20:00:00', 0, 0, 0),
